function load() {
  d3.select("#choose")
    .selectAll("option")
      .data(Object.keys(rawData).sort())
    .enter().append("option")
      .text(function(d) { return d })
  select()
}

function select() {
  d3.select("body").selectAll("svg").remove();

  var mime = document.getElementById("choose").value;
  var root = {
    name: mime,
    children: Object.keys(rawData[mime]).map(function(k) {
      return {name: k, size: rawData[mime][k]};
    })
  };

  var diameter = Object.keys(rawData[mime]).length >= 50 ? 2500 : 500,
    format = d3.format(",d"),
    color = d3.scale.category20c();

  var bubble = d3.layout.pack()
    .sort(null)
    .size([diameter, diameter])
    .padding(1.5);

  var svg = d3.select("body").append("svg")
    .attr("width", diameter)
    .attr("height", diameter)
    .attr("class", "bubble");

  var node = svg.selectAll(".node")
      .data(bubble.nodes(classes(root))
      .filter(function(d) { return !d.children; }))
    .enter().append("g")
      .attr("class", "node")
      .attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ")"; });

  node.append("title")
      .text(function(d) { return d.className + ": " + format(d.value); });

  node.append("circle")
      .attr("r", function(d) { return d.r; })
      .style("fill", function(d) { return color(d.packageName); });

  node.append("text")
      .attr("dy", ".3em")
      .style("text-anchor", "middle")
      .text(function(d) { return d.className.substring(0, d.r / 3); });

  d3.select(self.frameElement).style("height", diameter + "px");

  // scroll to center, based on http://www.webdeveloper.com/forum/showthread.php?271615-Scroll-to-center-of-the-page
  window.scrollTo(($(document).width()-$(window).width())/2,($(document).height()-$(window).height())/2);
}

// Returns a flattened hierarchy containing all leaf nodes under the root.
function classes(root) {
  var classes = [];

  function recurse(name, node) {
    if (node.children) node.children.forEach(function(child) { recurse(node.name, child); });
    else classes.push({packageName: name, className: node.name, value: node.size});
  }

  recurse(null, root);
  return {children: classes};
}
